import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';

const LeftMenu = styled.div`
    display: flex;
    align-items: center;
    justify-content: space-between;
    gap: 1rem;

    a{
        font-size: 2rem;
        font-weight: 500;
        padding: 1.6rem 0.5rem;
        span.nav-stick{
            width: calc(100% - 1rem);
            height: .1rem;
            display: block;
            background-color: #181818;
        }
        &:hover {
            color: ${props => props.theme.logo.pink};

            span.nav-stick{
                background-color: ${props => props.theme.logo.pink};
            }
        }
        &#onNav{
            color: ${props => props.theme.logo.pink};
        }
    }
`

function LeftSide() {
  return (
      <LeftMenu>
          <Link to={`/gallery`} id='onNav'>Gallery<span className='nav-stick'></span></Link>
          <Link to={`/health`}>Health</Link>
          <Link to={`/goods`}>Goods</Link>
          <Link to={`/together`}>Together</Link>
          <Link to={`/board`}>Board</Link>
      </LeftMenu>
  );
}

export default LeftSide;
